import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import 'bootstrap/dist/css/bootstrap.min.css';

function App() {

  return (
    <div className="App">
      <Container>
        <Row>
          <Col>
            <div className='livechart'>
              <LiveData />
            </div>
          </Col>
          <Col>
            <div>
              <h1>reservoir level</h1>
            </div>
          </Col>
        </Row>
        <Row>
          <Col>
            <div className='chartdata'>
              <ChartData />
            </div>

          </Col>

        </Row>
      </Container>

    </div>
  );
}

export default App;
